const tooltipTriggerList = document.querySelectorAll(
    '[data-bs-toggle="tooltip"]',
  ),
  tooltipList = [...tooltipTriggerList].map((t) => new bootstrap.Tooltip(t));
function showErrorToast(t) {
  Toastify({
    text: t,
    duration: 3e3,
    gravity: 'top',
    position: 'right',
    stopOnFocus: !0,
    className: 'bg-warning',
  }).showToast();
}
